def find_transaction(product_name, transactions)
  transaction = transactions.find { |t| t[:product_name] == product_name }
  if transaction
    { quantity: transaction[:quantity], 
      total_price: transaction[:total_price], 
      transaction_id: transaction[:transaction_id] 
    }
  end
end
